import React from "react";

function AIDoctor() {
  return (
    <div className="chat-view w-full h-full flex justify-center items-center">
      <div className="chat-body w-full h-screen m-10 flex justify-center items-center rounded-3xl shadow-animate relative">
        <div className="chat w-full h-full bg-[#202024] text-white rounded-3xl m-10 z-10 flex flex-col">
          <div className="flex h-full w-full">
            <div className="widget w-96 bg-[#202024] m-10 rounded-3xl shadow-[#0c090e] shadow-[0_0px_20px] border border-[#750c85] flex flex-col p-10 items-center gap-5">
              <h1 className="text-xl font-bold">AIDoctor</h1>
              <p className="text-sm">Welcome to AI Doctor</p>
            </div>
            <div className="chat h-full w-full flex justify-center items-center">
              <div className="chat-area flex-1 bg-black  w-full h-full relative">
                <h1>Chat Area</h1>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AIDoctor;
